-- showState --
---------------

allPassedShowState :: Bool
allPassedShowState = null allTestsShowState

allTestsShowState :: [(String, Bool)]
allTestsShowState = [(str,test) | 
   (str, test) <- [   
        ("showState (Alive 1) == \"1\"", showState (Alive 1) == "1")
      , ("showState (Alive \"aa\") == \"\\\"aa\\\"\"", showState (Alive "aa") == "\"aa\"")
      , ("showState (Alive True) == \"True\"", showState (Alive True) == "True")
      , ("showState (Dead :: State ()) == \"Dead\"", showState (Dead :: State ()) == "Dead")
      , ("showState (Alive 5) == \"5\"", showState (Alive 5) == "5")
      , ("showState (Alive True) == \"True\"", showState (Alive True) == "True")
      , ("showState (Alive 'a') == \"'a'\"", showState (Alive 'a') == "'a'")
    ], not test]

